import * as React from 'react';
import Button from '@mui/material/Button';
import { Box } from '@mui/material';
//import { useState , useEffect } from 'react';
import Paper from '@mui/material/Paper';
import { IconButton, Typography } from '@mui/material';
import LooksOneIcon from '@mui/icons-material/LooksOne';
import DeleteIcon from '@mui/icons-material/Delete';


function Settings() {

  return (
    <Box  >
    <Button variant="contained" disableElevation sx={{ml:130 }} style={{backgroundColor:"orange" , color:"white"}}>
      أضف حصة
    </Button>
    <Paper  
  
  
    sx={{
      position:"relative",
      width:"940px",
      display:"flex",
      justifyContent:"space-between",
      mt:"1px",
      mb:"10px",
      pt:"15px",
      pb:"7px",
      //width: {xs:"340px",sm:"340px",md:"340px"},
      mr:{xs:"200px"},
      ml:{sm:"200px"}

  
    }}
    style={{backgroundColor:"grey[500]"}}
   >

    <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>
    <Button variant="contained" disableElevation style={{backgroundColor:"orange" , color:"white"}}>
      أضف حصة
    </Button>

     <Button variant="contained" disableElevation style={{backgroundColor:"orange" , color:"white"}}>
      أضف حصة
    </Button>
<IconButton 
      sx={{position:"absolute"  , right:"0" }}>
        <DeleteIcon/>

      </IconButton>
     </Typography>

    <Typography
     sx={{
      mr:"35px", 
      fontSize:"1.4em",
      fontWeight:"500",
      }}
      style={{color:"black"}}
       variant='h6'>الحصه الاولي </Typography>

<IconButton 
      sx={{position:"absolute"  , right:"0" }}>
        <LooksOneIcon  />

      </IconButton>
    </Paper>
    </Box>
  )
}

export default Settings
